import React from "react";
import { Text, View, StyleSheet } from "react-native";

const List = ({ data }) => {
  return data.map((dataElement) => (
    <View key={dataElement}>
      <Text>{dataElement}</Text>
    </View>
  ));
};

export default List;

const styles = StyleSheet.create({
  listItem: {
    borderRadius: 6,
    paddingHorizontal: 8,
    paddingVertical: 4,
  },
});
